import React from 'react'
import './style.css';

const NavBar = () => {
  return (
    <div className='navBar'>
        <ul>
          <li><a>Menu</a></li>
          <li><a>Api</a></li>
          <li><a>Lessons</a></li>
          <li style="float:right"><a>Coming soon</a></li>

        </ul>
    </div>
  )
}

export default NavBar;
